import React from "react";
import Particles from "react-particles-js";

class parts extends React.Component {
  render() {
    <Particles
      params={{
        particles: {
          number: {
            value: 50
          },
          size: {
            value: 3
          }
        },
        interactivity: {
          events: {
            onhover: {
              enable: true,
              mode: "repulse"
            }
          }
        }
      }}
    />;
  }
}

export default parts;
